alb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Zec='Dienstag',oBc='Dimension',Imc='Dimension [height=',Dxc='DirectionalTextHelper',nfc='Do',gfc='Do.',Gxc='DockLayoutPanel',Hxc='DockLayoutPanel$Direction',Ixc='DockLayoutPanel$Direction;',Lxc='DockLayoutPanel$DockAnimateCommand',Jxc='DockLayoutPanel$LayoutData',Otc='DomEvent',Ttc='DomEvent$Type',_ec='Donnerstag',Yzc='Double',Jjc='EAST',icc='EEE, d MMM yyyy HH:mm:ss Z',Epc='EEE. dd MMM. yyyy HH:mm:ss',Ccc='EEEE d. MMMM',lcc='EEEE, d. MMMM y',Kac='EM',ohc='EMPTY',thc='ENABLED',Afc='END',Mac='EX',kwc='ElementMapperImpl',lwc='ElementMapperImpl$FreeNode',Aec='English',_sc='Enum',rec='Etc/GMT',tec='Etc/GMT+',sec='Etc/GMT-',_ac='Event type',czc='Event$NativePreviewEvent',euc='EventBus',qsc='EventObject',vsc='Exception',nic='Expecting version 6 from server, got ',Wbc='F',Nnc='F8834F07517EF3B7D02B9E845E5E1B88',Fac='FIXED',Lic='FLOAT',snc='Fail: ',Mdc='Feb',Rec='Feb.',Gec='Februar',Adc='February',jrc='Female',Zzc='Float',Mxc='FlowPanel',kxc='FocusWidget',Klc='For input string: "',ofc='Fr',hfc='Fr.',afc='Freitag',mec='Fri',dec='Friday',nbc='GET',Vpc='GGD55XLBAH',Hrc='GGD55XLBAJ',Uqc='GGD55XLBBI',Upc='GGD55XLBCH',Wqc='GGD55XLBCI',Rgc='GGD55XLBDB',Tpc='GGD55XLBDH',Qrc='GGD55XLBDJ',Dqc='GGD55XLBDK',rgc='GGD55XLBEB',Rpc='GGD55XLBEH',Vqc='GGD55XLBEI',Irc='GGD55XLBEJ',Sgc='GGD55XLBFB',Ypc='GGD55XLBFH',rrc='GGD55XLBFI',hsc='GGD
